// @updateURL https://update.greasyfork.org/scripts/560414/%E7%A6%81%E6%AD%A2%20Web%20%E5%BB%B6%E8%BF%9F%E5%8A%A0%E8%BD%BD%E5%9B%BE%E7%89%87%EF%BC%88%E6%94%B9%EF%BC%89.meta.js
