(function() {
    'use strict';

    // --- 配置区域 ---
    const CURRENT_HOST = window.location.hostname;
    const WHITELIST_KEY = 'anti_lazy_whitelist';
    const PROCESSED_ATTR = 'data-anti-lazy-processed';

    // 排除列表：某些特定域名的图片如果不需要处理，可在此添加
    const GLOBAL_EXCLUDED_KEYWORDS = [];

    // --- 1. 菜单管理系统 (控制脚本开启/关闭) ---

    function getWhitelist() {
        return GM_getValue(WHITELIST_KEY, []);
    }

    function isEnabled() {
        const list = getWhitelist();
        return list.includes(CURRENT_HOST);
    }

    function toggleStatus() {
        const list = getWhitelist();
        const index = list.indexOf(CURRENT_HOST);

        if (index === -1) {
            list.push(CURRENT_HOST);
            alert(`✅ 已在 [${CURRENT_HOST}] 开启强制加载。\n页面即将刷新以生效。`);
        } else {
            list.splice(index, 1);
            alert(`🛑 已在 [${CURRENT_HOST}] 恢复默认加载。\n页面即将刷新。`);
        }

        GM_setValue(WHITELIST_KEY, list);
        window.location.reload();
    }

    // 注册油猴菜单
    function registerMenu() {
        // 移除旧菜单（防止重复注册）
        // 注意：不同脚本管理器处理 unregister 的方式不同，这里直接覆盖注册通常是安全的
        const enabled = isEnabled();
        const menuText = enabled ? `🔴 在此网站禁用 (当前: 开启)` : `🟢 在此网站开启 (当前: 关闭)`;
        GM_registerMenuCommand(menuText, toggleStatus);
    }

    // 初始化菜单
    registerMenu();

    // --- 2. 状态检查 ---
    // 如果当前网站不在白名单中，脚本直接停止运行，零资源占用
    if (!isEnabled()) {
        console.log(`[禁止 Web 延迟加载] 当前域名 (${CURRENT_HOST}) 未在白名单中，脚本休眠。`);
        return;
    }

    console.log(`[禁止 Web 延迟加载] 正在全速运行...`);

    // --- 3. 核心处理逻辑 (优化版) ---

    function isExcluded(url) {
        return GLOBAL_EXCLUDED_KEYWORDS.some(keyword => url.includes(keyword));
    }

    function updateImageSource(img) {
        // 防止重复处理
        if (img.getAttribute(PROCESSED_ATTR)) return;

        const dataset = img.dataset;
        // 尝试获取各种可能的懒加载属性
        const potentialSrc = dataset.src || dataset.original || dataset.lazySrc || dataset.origin || dataset.img || dataset.url;
        const potentialSrcset = dataset.srcset;

        // 如果没有任何懒加载迹象，跳过
        if (!potentialSrc && !potentialSrcset && img.loading !== 'lazy' && !img.classList.contains('lazyload')) {
            return;
        }

        // 处理 SRC
        if (potentialSrc && !isExcluded(potentialSrc)) {
            if (potentialSrc.startsWith('data:image')) {
                img.src = potentialSrc;
            } else {
                try {
                    // 尝试转为绝对路径
                    img.src = new URL(potentialSrc, window.location.href).href;
                } catch (e) {
                    img.src = potentialSrc;
                }
            }
        }

        // 处理 SRCSET (仅在存在新值时覆盖，保护原有的高清适配)
        if (potentialSrcset) {
            img.srcset = potentialSrcset;
        }

        // 核心：强制立即加载
        img.loading = 'eager';

        // 辅助：尝试立即解码
        if (img.decode) {
            img.decode().catch(() => {});
        }

        // 清理 CSS 类名
        img.classList.remove('lazy', 'lazyload', 'lazy-hidden', 'lazy-loaded');

        // 清理 data 属性 (保留 sizes 属性以维持布局)
        img.removeAttribute('data-src');
        img.removeAttribute('data-original');
        img.removeAttribute('data-srcset');

        // 标记已处理
        img.setAttribute(PROCESSED_ATTR, 'true');
    }

    function processNode(node) {
        if (node.tagName === 'IMG') {
            updateImageSource(node);
        } else if (node.querySelectorAll) {
            node.querySelectorAll('img').forEach(updateImageSource);
        }
    }

    // --- 4. 监听器 (MutationObserver) ---

    const observer = new MutationObserver(mutations => {
        mutations.forEach(mutation => {
            if (mutation.type === 'childList') {
                mutation.addedNodes.forEach(processNode);
            } else if (mutation.type === 'attributes') {
                updateImageSource(mutation.target);
            }
        });
    });

    observer.observe(document.documentElement, {
        childList: true,
        subtree: true,
        attributes: true,
        attributeFilter: ['data-src', 'data-original', 'data-srcset', 'class', 'src']
    });

    // --- 5. 初始执行 ---
    window.addEventListener('DOMContentLoaded', () => {
        // 使用 requestAnimationFrame 避免阻塞页面初始化渲染
        requestAnimationFrame(() => {
            document.querySelectorAll('img').forEach(updateImageSource);
        });
    });

})();